        <nav style={{display:"flex",justifyContent:"space-around",alignItems:"center",color:"white",height:"50px",
    backgroundColor: "rgb(82, 113, 141)"}}> <h1>home</h1>
        <Link to="/Register" className="h1" > LOG OUT </Link>
        <Link to="/Dashbord" className="h1" > Admin </Link></nav>
        
       
    </div>)
}
